import React, { Component } from 'react';
import axios from 'axios';

const Agreement = props => (
    <tr>
        <td className="align-middle">{props.agreement.landlord}</td>
        <td className="align-middle">${props.agreement.rent}</td>
        <td className="align-middle">{props.agreement.address}</td>
        <td className="align-middle">${props.agreement.rentHiked}</td>
        {/* <td>
            <Link to={"/edit/"+props.agreement._id}>Edit</Link> | <a href="#" onClick={() => { props.payRent(props.agreement._id) }}>Pay rent</a>
        </td> */}
        <td className="align-middle">
            {props.agreement.rentHiked === 0 ? (
                <button className="btn btn-danger ml-2" onClick={() => this.handleOpenModal(props.agreement._id)}>Update Rent</button>
            ) : (
                <button className="btn btn-secondary ml-2">Some Other Button</button>
            )}
        </td>
        <td>
            <img src={props.agreement.image} alt="Agreement" className="rounded" style={{ width: '200px', height: '100px' }} />
        </td>
    </tr>
)

export default class EditAgreement extends Component {
    constructor(props) {
        super(props);
        this.onChangeRent =  this.onChangeRent.bind(this);
        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            agreements: [], 
            maxPercentageIncrease: 0, 
            year: 0, 
            newRentValue: 0, 
            addresses: [],
            tenant: '',
            landlord: '',
            rent: 0,
            address: '',
            image: '',
            rentHiked: 0,
        };
    }

    componentDidMount() {
        axios.get('http://localhost:5000/agreement')
        .then(response => {
            this.setState({ agreements: response.data })
            this.setState({ addresses: response.data.map(agreement => agreement.address)})
        })
        .catch((error) => {
            console.log(error);
        })
        axios.get('http://localhost:5000/policy')
        .then(response => {
            this.setState({ year: response.data[0].year })
            this.setState({ maxPercentageIncrease: response.data[0].maxPercentageIncrease })
        })
        .catch((error) => {
            console.log(error);
        })
    }

    onChangeRent(e) {
        this.setState({
            newRentValue: e.target.value
        });
    }

    onSubmit(e) {
        e.preventDefault();

        const agreement = {
            tenant: this.state.tenant,
            landlord: this.state.landlord,
            rent: parseInt(this.state.rent),
            address: this.state.address,
            image: this.state.image,
            rentHiked: this.state.rentHiked,
        }
        console.log(agreement);
        axios.post('http://localhost:5000/agreement/update/'+this.props.match.params.id, agreement)
        .then(res => console.log(res.data));

        self.componentDidMount();
    }


    agreementList() {
        return this.state.agreements.map(currentagreement => {
            return <Agreement agreement={currentagreement}  payRent={this.payRent} key={currentagreement._id}/>;
        })
    }

    render() {
        return (
            <div>
                <h3>Edit Agreement Log</h3>
               <form onSubmit={this.onSubmit}>
                <div className = "form-group">
                    <label>Username: </label>
                    <select ref="userInput"
                        required
                        className="form-control"
                        value={this.state.username}
                        onChange={this.onChangeUserName}>
                        {
                            this.state.users.map(function(user) {
                                return <option
                                    key={user}
                                    value={user}>{user}
                                    </option>;
                            })
                        }
                    </select>    
                </div>
                <div className="form-group">
                    <label>Description: </label>
                    <input type="text"
                        required
                        className="form-control"
                        value={this.state.description}
                        onChange={this.onChangeDescription}
                        />
                </div>
                <div className="form-group">
                    <label>Duration (in minutes): </label>
                    <input type="text"
                        required
                        className="form-control"
                        value={this.state.duration}
                        onChange={this.onChangeDuration}
                        />
                </div>

                <div className="form-group">
                    <input type="submit" value="Edit Exercise Log" className="btn btn-primary" />
                </div>
               </form>
            </div>
        );
    }
}
